{"type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v3.json",
  "data": [
    {
      "name": "stats_over_time_actual",
      "url": {
        "index": "licensing-report*",
        "%context%": true,
      "%timefield%": "event_timestamp",        
        "body": {
          "aggs": {
            "weekly": {
              "date_histogram": {
                "field": "event_timestamp",
                "interval": "week"
              },
              "aggs": {
                "unique_count": {"cardinality": {"field": "user.keyword"}},
                "daily": {
                  "date_histogram": {
                    "field": "event_timestamp",
                    "interval": "day"
                  },
                  "aggs": {
                    "unique_count": {"cardinality": {"field": "user.keyword"}}
                  }
                },
                "average_bucket": {
                  "avg_bucket": {"buckets_path": "daily>unique_count"}
                },
                "min_bucket": {
                  "min_bucket": {"buckets_path": "daily>unique_count"}
                },
                "max_bucket": {
                  "max_bucket": {"buckets_path": "daily>unique_count"}
                },
                "percentile_bucket": {
                  "percentiles_bucket": {"buckets_path": "daily>unique_count"}
                }
              }
            }
          }
        },
        "size": 0
      },
      "format": {"type": "json", "property": "aggregations.weekly.buckets"},
      "transform": [
        {
          "type": "project",
          "fields": [
            "key",
            "max_bucket.value",
            "min_bucket.value",
            "average_bucket.value",
            "percentile_bucket.values.1\\.0",
            "percentile_bucket.values.25\\.0",
            "percentile_bucket.values.75\\.0",
            "percentile_bucket.values.99\\.0",
            "unique_count.value"
          ],
          "as": [
            "event_timestamp",
            "max",
            "min",
            "mean",
            "first_quart",
            "second_quart",
            "third_quart",
            "fourth_quart",
            "count"
          ]
        },
        {
          "type": "formula",
          "expr": "timeFormat(datum.event_timestamp, '%Y-%m-%d')",
          "as": "event_timestamp"
        },
        {"type": "extent", "field": "min", "signal": "min"},
        {"type": "extent", "field": "max", "signal": "max"}
      ]
    },
    {
      "name": "licence_over_time_actual",
      "url": {
        "%context%": true,
      "%timefield%": "event_timestamp",        

        "index": "licensing-report*",
        "body": {
          "aggs": {
            "weekly": {
              "date_histogram": {
                "field": "event_timestamp",
                "interval": "week"
              },
              "aggs": {
                "unique_count": {"cardinality": {"field": "user.keyword"}}
              }
            }
          }
        },
        "size": 0
      },
      "format": {"type": "json", "property": "aggregations.weekly.buckets"},
      "transform": [
        {
          "type": "project",
          "fields": ["unique_count.value", "key"],
          "as": ["count", "event_timestamp"]
        },
        {"type": "formula", "expr": "'real'", "as": "type"},
        {
          "type": "formula",
          "expr": "timeFormat(datum.event_timestamp, '%Y-%m-%d')",
          "as": "event_timestamp"
        }
      ]
    },
    {
      "name": "last_data_pred",
      "url": {
        "index": "licensing-prediction-report*",
        "%context%": true,
        "body": {
          "aggs": {
            "last_prediction": {
              "top_hits": {
                "size": 1,
                "sort": [{"event_timestamp": {"order": "desc"}}],
                "_source": {"includes": ["event_timestamp", "prediction"]}
              }
            }
          }
        },
        "size": 0
      },
      "format": {
        "type": "json",
        "property": "aggregations.last_prediction.hits.hits"
      },
      "transform": [
        {
          "type": "project",
          "fields": ["_source.prediction", "sort"],
          "as": ["count", "event_timestamp"]
        },
        {"type": "formula", "expr": "'expected'", "as": "type"},
        {
          "type": "formula",
          "expr": "timeFormat(datum.event_timestamp, '%Y-%m-%d')",
          "as": "event_timestamp"
        }
      ]
    },
    {
      "name": "all_licence_over_time",
      "source": ["licence_over_time_actual", "last_data_pred"]
    }
  ],
  "signals": [
    {"name": "inter_plot", "update": "height/6"},
    {"name": "chart_height", "update": "[height, inter_plot]"},
    {"name": "box_plot_height", "update": "[0, inter_plot]"},
    {"name": "box_plot_domain", "update": "[min[0], max[1]]"}
  ],
  "scales": [
    {
      "name": "licence_percentage",
      "domain": {"data": "all_licence_over_time", "field": "count"},
      "nice": true,
      "range": {"signal": "chart_height"}
    },
    {
      "name": "box_plot",
      "domain": {"signal": "box_plot_domain"},
      "nice": true,
      "range": {"signal": "box_plot_height"}
    },
    {
      "name": "timestamp",
      "type": "band",
      "domain": {"data": "all_licence_over_time", "field": "event_timestamp"},
      "range": "width",
      "padding": 0.05,
      "round": true
    }
  ],
  "axes": [
    {
      "orient": "left",
      "scale": "licence_percentage",
      "grid": true,
      "gridWidth": 1,
      "labelFontSize": 16,
      "labelPadding": 25,
      "title": "Amount of unused licenses",
      "titleFontSize": 20,
      "titlePadding": 15
    },
    {
      "orient": "bottom",
      "scale": "timestamp",
      "grid": true,
      "gridWidth": 1,
      "labelAngle": 40,
      "labelPadding": 25,
      "labelFontSize": 16,
      "title": "Timestamp (weekly)",
      "titleFontSize": 20,
      "titlePadding": 15
    }
  ],
  "marks": [
    {
      "type": "line",
      "from": {"data": "licence_over_time_actual"},
      "encode": {
        "enter": {
          "x": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "y": {"scale": "licence_percentage", "field": "count"},
          "stroke": {"value": "#7D93C8"},
          "interpolate": {"value": "monotone"}
        },
        "update": {"strokeOpacity": {"value": 1}, "strokeWidth": {"value": 4}}
      }
    },
    {
      "type": "symbol",
      "from": {"data": "licence_over_time_actual"},
      "encode": {
        "enter": {
          "x": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "y": {"scale": "licence_percentage", "field": "count"}
        },
        "update": {
          "size": {"value": 300},
          "fill": {"value": "#323A50"},
          "color": {"value": "#7F1F00"},
          "opacity": {"value": 1},
          "tooltip": {"signal": "'Amout of unused licence : '+datum.count"}
        },
        "hover": {"opacity": {"value": 0.5}}
      }
    },
    {
      "type": "rect",
      "from": {"data": "last_data_pred"},
      "encode": {
        "enter": {
          "x": {"scale": "timestamp", "field": "event_timestamp"},
          "width": {"scale": "timestamp", "band": 1},
          "y2": {"signal": "0"},
          "y": {"signal": "height"},
          "opacity": {"value": "0.4"},
          "fill": {"value": "#39B539"}
        }
      }
    },
    {
      "type": "symbol",
      "from": {"data": "last_data_pred"},
      "encode": {
        "enter": {
          "x": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "y": {"scale": "licence_percentage", "field": "count"},
          "fillOpacity": {"signal": "datum.type == 'real' ? 0 : 1"},
          "strokeOpacity": {"signal": "datum.type == 'real' ? 0 : 1"}
        },
        "update": {
          "size": {"value": 300},
          "fill": {"value": "#323A50"},
          "color": {"value": "#7F1F00"},
          "opacity": {"value": 1},
          "tooltip": {"signal": "'Amout of unused licence : '+datum.count"}
        },
        "hover": {"opacity": {"value": 0.5}}
      }
    },
    {
      "type": "rule",
      "from": {"data": "stats_over_time_actual"},
      "encode": {
        "enter": {
          "x": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "x2": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "y2": {
            "scale": "licence_percentage",
            "field": "count",
            "offset": {"signal": "-scale('box_plot', datum.min) -5"}
          },
          "y": {
            "scale": "licence_percentage",
            "field": "count",
            "offset": {"signal": "-scale('box_plot', datum.max) - 15"}
          },
          "stroke": {"value": "#2C0067"}
        }
      }
    },
    {
      "type": "rect",
      "from": {"data": "stats_over_time_actual"},
      "encode": {
        "enter": {
          "x": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2.1"}
          },
          "width": {"scale": "timestamp", "band": 0.05},
          "y2": {
            "scale": "licence_percentage",
            "field": "count",
            "offset": {"signal": "-10 - scale('box_plot', datum.first_quart)"}
          },
          "y": {
            "scale": "licence_percentage",
            "field": "count",
            "offset": {"signal": "-scale('box_plot', datum.fourth_quart) - 10"}
          },
          "fill": {"value": "#ffffff"},
          "stroke": {"value": "#701CF9"}
        }
      }
    }
  ]
}"},"title":"[TGS] Unused Licence Over Time"}

{"type":"vega","aggs":[],"params":{"spec":"{
